    useEffect(() => {
        const fetchData = async () => {
            try {
                const res = await axios.post({
                    url: "http://127.0.0.1:8000/auth/jwt/create/", data: {
                        email: "moustafashahin122@gmail.com",
                        password: "lovelove122@A",
                    }
                });

                console.log("ðŸš€ ~ file: App.js:16 ~ fetchData ~ res:", res);
                setResponse(await JSON.stringify(res.data.access));
                console.log("ðŸš€ ~ file: App.js:8 ~ App ~ response:", response);
            } catch (error) {
                console.error(error);
            }
        };
        fetchData();
    }, []);



    return (


        <p>
            {response}
        </p>

    );
};

export default TestAxios;
